package learning;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class AnagramCheck {
	public static void main(String[] args) {
		String s1 = "";
		String s2 = "";
		System.out.println(isAnagram3(s1, s2));
	}

	private static boolean isAnagram(String s1, String s2) {
		if (s1.length() != s2.length()) return false;
		Map<Character, Integer> map1 = charMapCount(s1);
		Map<Character, Integer> map2 = charMapCount(s2);
		
		for (Map.Entry<Character, Integer> entry : map1.entrySet()) {
			char c = entry.getKey();
			if (!map2.containsKey(c)) {
				return false;
			} else if (map2.get(c).intValue() != map1.get(c).intValue()) {
				return false;
			}
		}
		return true;
		
	}
	
	private static Map charMapCount(String s) {
		Map<Character, Integer> map = new HashMap<>();
		for (char c: s.toCharArray()) {
			if(map.containsKey(c)) {
				map.put(c, map.get(c)+1);
			} else {
				map.put(c, 1);
			}
		}
		return map;
	}
	
	private static boolean isAnagram2(String s1, String s2) {
		char[] c1 = s1.toCharArray();
		char[] c2 = s2.toCharArray();
		Arrays.sort(c1);
		Arrays.sort(c2);
		return Arrays.equals(c1, c2);
	}
	
	private static boolean isAnagram3(String s1, String s2) {
		if (s1.length() != s2.length()) return false;
		int[] counter = new int[26];
		for (int i=0;i<s1.length();i++) {
			counter[s1.charAt(i)-'a']++;
			counter[s2.charAt(i)-'a']--;
		}
		
		for (int count: counter) {
			if (count>0) return false;
		}
		return true;
		
	}
	

}
